// import libaries
import React, { Component } from 'react';

// import components
import Home from './components/Home';
import Welcome from './components/Welcome';


class App extends Component {

  constructor(){
    super();
    this.state = {
      user: 'Josefine'
    };
  }

  render(){
    return (
      <div>
        {this.state.user && <Welcome user={this.state.user} /> }
        <Home user={this.state.user} /> 
      </div>
    );
  }
}

export default App;
